
apiVersion: extensions/v1beta1 
kind: Ingress
metadata:
  name: ing1-svc1-ns1 
  namespace: ns1
  annotations:
     ingress.kubernetes.io/allow-http: "true"
     kubernetes.io/ingress.class: f5
     'virtual-server.f5.com/ip': "10.169.215.33" 
     virtual-server.f5.com/health: |
      [
        {
          "path":     "www.ing1-svc1-ns1.com/",
          "send":     "GET / HTTP/1.1\r\nHost: www.ing1-svc1-ns1.com\r\nConnection: Close\r\n\r\n",
          "interval": 5,
          "timeout":  10
        }
      ]
spec:
  rules:
   - host: www.ing1-svc1-ns1.com 
     http:
       paths:
       - path: /
         backend:
            serviceName: svc1-ns1
            servicePort: 80
---

